import React from "react";
import Page1 from "./assets/page1";
import Page2 from "./page2";
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
  NavLink
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavLink to='/page1'>Page1</NavLink>
      <NavLink to='/page2'>Page2</NavLink>
      <BrowserRouter>
        <Routes>
          <Route exact path='/'>
            <Page1 />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
